import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../home/Home.css';
import Sidebar from '../sidebar/sidebar';
import Header from '../sidebar/header';

class Order extends React.Component<any, any> {
    constructor(props:any) {
        super(props);
        this.state = {
          data: null
        };
      }


    render(){
        return (
            <div className="wrapper">
                <Sidebar/>
            <div id="content">
            <Header/>
                <div style={{padding: "20px"}}>
                <h2>Chức năng thao tác đơn hàng</h2>
                <div className="row">
                    <div className="col-sm-4">
                        <div className="row">
                            <div className="col-sm-4">
                                <strong>Tìm kiếm:</strong>
                            </div>
                            <div className="col-sm-8">
                                <input className="form-control" type="text" placeholder="Search" aria-label="Search"/>
                            </div>
                        </div>
                    </div>
                    <div className="col-sm-3">

                    </div>
                    <div className="col-sm-3">
                        <div className="row">
                            <div className="col-sm-6" style={{textAlign:"center"}}>
                                <strong>Thêm mới:</strong>
                            </div>
                            <div className="col-sm-6">
                                {/* <button type="button" className="btn btn-success">Thêm</button> */}
                                <button type="button" className="btn btn-success" data-toggle="modal" data-target="#exampleModal">Thêm</button>
                            </div>                            
                        </div>
                    </div>
                    <div className="col-sm-2">
                        <div className="row">
                            <div className="col-sm-5">
                                <strong>Export:</strong>
                            </div>
                            <div className="col-sm-7">
                                <button type="button" className="btn btn-success">Export</button>
                            </div>                            
                        </div>
                    </div>
                </div>
                

                <div className="line"></div>

                <h2>Danh mục khách hàng</h2>
                
                </div>
            </div>
        </div>
        );
    }

}

export default Order;
